        <>
        <div className={"menu " + (menuOpen && "menuAct")}>
                   <ul>
                       <li><a href="#Intro" onClick={()=>{menuClose(!menuOpen);}}>Home</a></li>
                       <li><a href="#Skill" onClick={()=>{menuClose(!menuOpen);}}>Skills</a></li>
                       <li><a href="#" onClick={()=>{menuClose(!menuOpen);}}>Projects</a></li>
                       <li><a href="#" onClick={()=>{menuClose(!menuOpen);}}>Contact</a></li>
                   </ul>
               </div>
        </>
    );
}
